function LaunchIt{
    
    $user_modset = $bwconfig.bw.MODSETS.MODSET | where {$_.setname -eq $MSComboBox.SelectedItem}
    $modlist = $user_modset.mods -split ';'
    $modlist = $modlist | where {$_ -ne ''}

    #Look at the registry for A3 (x86/x64 safe)
    $BIS_REGS = ('HKLM:\SOFTWARE\Wow6432Node\Bohemia Interactive Studio\ArmA 3',
				    'HKLM:\SOFTWARE\Bohemia Interactive Studio\ArmA 3',
				    'HKLM:\SOFTWARE\Wow6432Node\Bohemia Interactive\ArmA 3',
				    'HKLM:\SOFTWARE\Bohemia Interactive\ArmA 3')
    $ARMA_PATH=''

    foreach ($reg in $BIS_REGS)
    {
	    if(test-path $reg)
	    {
		    $ARMA_PATH = get-itemproperty $reg | select -expandproperty main
		    #write-output $ARMA_PATH
	    }
    }	

    if($ARMA_PATH -eq '')
    {
	    [void][System.Windows.MessageBox]::Show('Arma 3 does not exist in the registry, or could not be found')
	    exit
    }
    else
    {
	    if(test-path $($ARMA_PATH + '\' + $A3_EXE))
	    {
		    write-output "Arma 3 found in the current path"
	    }
	    else
	    {
		    [System.Windows.MessageBox]::Show("Arma 3 could not be found in the current path")
		    exit
	    }
    }

    if($PATH_TO_MODS)
    {
	    $MODPATH = $ARMA_PATH + '\' + $PATH_TO_MODS
	    if(test-path -literalpath $MODPATH)
	    {
		    #write-output "found mods"
	    }
	    else
	    {
		    [void][System.Windows.MessageBox]::Show("Path to mods " + $PATH_TO_MODS + " specified, but does not exist, exiting")
		    exit
	    }
    }

    $FINAL_MODS = ''
    foreach ($MOD in $MODLIST)
    {
	
	    if($PATH_TO_MODS)
	    {
		    if(test-path -literalpath $($ARMA_PATH + '\' + $PATH_TO_MODS + '\' +$MOD))
		    {
			    $FINAL_MODS += $($PATH_TO_MODS+'\'+$MOD+';')
		    }
		    else
		    {
			    #Write-output "Could not find "$MOD" searching workshop installation"
			    if(test-path -literalpath $($ARMA_PATH + '\' + '!workshop' + '\' +$MOD))
			    {
				    #Write-output "Found "$MOD" in workshop"
				    $FINAL_MODS += $('"!workshop'+'\'+$MOD+'";')
			    }
			    else
			    {
				    write-error "Could not find an installation of " $MOD
				    exit
			    }
		    }
	    }
	    else
	    {
		    if(test-path -literalpath $($ARMA_PATH + '\' +$MOD))
		    {	
		
			    $FINAL_MODS += $($MOD+';')
		    }
		    else
		    {
			    #Write-output "Could not find "$MOD" searching workshop installation"
			    if(test-path -literalpath $($ARMA_PATH + '\' + '!workshop' + '\' +$MOD))
			    {
				    #Write-output "Found "$MOD" in workshop"
				    $FINAL_MODS += $('"!workshop'+'\'+$MOD+'";')
			    }
			    else
			    {
				    write-error "Could not find an installation of " $MOD
				    exit
			    }
		    }
	    }
    }
    
    $CMD = $ARMA_PATH + '\' + $A3_EXE
    if($MMCheckbox.Checked){

        $ARGS = $LAUNCH_PARAMS + ' ' + $DEV_LAUNCH_PARAMS
    }
    else{
        $ARGS = $LAUNCH_PARAMS
    }
    
    if($AutoConnCB.Checked -eq $true){
        $ARGS += ' -connect=' + $IPTextBox.Text + ' -port=' + [string]$PortTextBox.Text + ' -password=' + $PWTextBox.Text
    }

    $ARGS += ' -mod=' + $FINAL_MODS
    
    start-process -filepath $CMD -ARGUMENTLIST $ARGS
    


}


